import React, { Component } from "react";
import { Menu, Button, Icon } from "antd";

const { SubMenu } = Menu;

class AppNavbar extends Component {
  state = {};
  render() {
    return (
      <Menu mode="horizontal">
        <Menu.Item key="home">
          <Icon type="home" />
          SUSTechDoc
        </Menu.Item>
      </Menu>
    );
  }
}

export default AppNavbar;
